  false,\n\t\"url\": null,\n\t\"notes\": \"This Parcels and Land Ownership dataset,
  published at 1:1200 (1in=100ft) scale, was produced all or in part from Published
  Reports/Deeds information as of 2011. It is described as 'The Tax Parcel shows the
  area and boundary of each property in a seamless layer covering the whole county
  along with the ability to connect to other matching tables.'. This data set includes
  internal links to Building Permit data. This data set includes internal links to
  Assessment/CAMA data. Key attributes of this data set include (but are not limited
  to): Deeded Acreage,Deed Book and Page,Land Use Code Data by this publisher are
  often provided in State Plane coordinate system; in a Lambert Conformal-conic projection;
  The extent of these data is generally Washington County, MD,Clear Spring, MD,Boonsboro,
  MD,Fort Ritchie, MD,Funkstown, MD,Hagerstown, MD,Halfway, MD,Hancock, MD,Keedysville,
  MD,Maugansville, MD,Mount Aetna, MD,Paramount-Long Meadow, MD,Rohrersville, MD,Sharpsburg,
  MD,St. James, MD,Williamsport, MD,Wilson-Conococheague, MD. This metadata was auto-generated
  through the Ramona GIS Inventory System (www.gisinventory.net) and does not represent
  all information about this data set.\",\n\t\"license_title\": null,\n\t\"extras\":
